import React from "react";
import prueba from './components/prueba';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";


function App() {
  return (
    <div>
      <h1> test </h1>
      <Router>
        <Switch>
          <Route path="/prueba" component={prueba} />
        </Switch>
      </Router>
    </div>
    
  );
}

export default App;
